export class AudioPlayer {
  private audio: HTMLAudioElement;
  private isPlayingAllowed: boolean;
  private userInteracted: boolean;

  constructor(audioUrl: string) {
    this.audio = new Audio(audioUrl);
    this.isPlayingAllowed = false;
    this.userInteracted = false;
    this.handleUserInteraction = this.handleUserInteraction.bind(this);
    document.addEventListener("click", this.handleUserInteraction);
    document.addEventListener("keydown", this.handleUserInteraction);
  }

  private updatePlayAllowed(): void {
    this.isPlayingAllowed = this.userInteracted;
  }

  private handleUserInteraction(): void {
    this.userInteracted = true;
    this.updatePlayAllowed();
  }

  public setVolume(volume: number): void {
    this.audio.volume = volume;
  }

  public play(): void {
    if (this.isPlayingAllowed) {
      this.audio.play();
    } else {
      console.error(
        "Playback is not allowed until the user interacts with the website."
      );
    }
  }

  public isPlaying(): boolean {
    return !this.audio.paused;
  }

  public stop(): void {
    this.audio.pause();
    this.audio.currentTime = 0;
  }

  public enableLoop(): void {
    this.audio.loop = true;
  }

  public disableLoop(): void {
    this.audio.loop = false;
  }
}

const music = new AudioPlayer(
  "data:video/ogg;base64,"
);
const bombSound = new AudioPlayer(
  "data:audio/wav;base64,"
);
const preAppearanceSound = new AudioPlayer(
  "data:audio/wav;base64,"
);
const appearanceSound = new AudioPlayer(
  "data:audio/wav;base64,"
);
const damageSound = new AudioPlayer(
  "data:audio/wav;base64,"
);
const gunSound = new AudioPlayer(
  "data:audio/wav;base64,"
);

gunSound.enableLoop();
music.enableLoop();

window.sounds = {
  music,
  gunSound,
  bombSound,
  preAppearanceSound,
  appearanceSound,
  damageSound,
};
